import React from 'react';
import imagen from '../assets/logoNavBar.png';
import { Link } from 'react-router-dom';
import '../App.css';



function Nav() {

    return (
        <nav>
            <Link to='/'>
                <img className="round" src={imagen} alt="jugador" />
            </Link>
            <ul className="nav-links">
                < Link to='/jugadores'>
                    <li>Jugadores</li>
                </Link>
                < Link to='crear-jugador'>
                    <li>Crear Jugador</li>
                </Link>
            </ul>
        </nav>
    )
}

export default Nav;
